import React, { Component } from 'react'
import Geocode from "react-geocode";

class GeoCode extends React.Component {
    render() { 
        const Geo = () => {
            Geocode.setApiKey("AIzaSyDD_EyIVFiO-R51XzLDqZlF5824t3KFaAg");
            Geocode.fromAddress("Effel Tower").then(
                response => {
                    const {lat, lng} = response.results[0].geometry.location;
                    console.log(lat, lng);
                },
                error => {
                    console.error(error);
                }
            );
        }
        return (
            <div>
                <h1>
                    {Geo()}
                </h1>
            </div>
        );
    }
}

export default GeoCode;
